import { ArrowBackOutlined } from "@material-ui/icons";
import "./watch.scss";

export default function Watch() {
  return (
    <div className="watch">
      <div className="back">
        <ArrowBackOutlined />
        Home
      </div>
      <video
        src="https://www.flexclip.com/res/preview/720p/action-movie-trailer.mp4"
        autoPlay
        controls
        progress
      ></video>
    </div>
  );
}
